import React from 'react';
import './Progress.css';




const Progress=(props)=> {

    return(
    <div>
       <div className="containerStatus">
           <div className="ui equal width grid">
               <div className="column">
                   <div className="ui segment">Progress:</div>
               </div>
               <div className="column">
                   <div className="ui segment">Failed:</div>
               </div>
           </div>
       </div>
        <div className="ui indicating progress" data-value="60">
            <div className="bar"></div>
            <div className="label">PassRate</div>
        </div>
    </div>
    )
}

export default Progress;
